	 <div className="input1">
	 <label>
    Name: <br />
     <input value={name} onChange={(e) => setName(e.target.value)} type="text" name="name" />
     </label>
	 </div>
	 <div className="input2">
	 <label>
    Age: <br />
    <input va onChange={(e) => setAge(e.target.value)} type="number" name="name" />
    </label>
	</div>
	</div>;
}

export default App;
